import React from 'react';
import { NavLink } from 'react-router-dom';
import { FeatureTabs } from './OnlineOfflineMethodData';

const Tabs = FeatureTabs.map(item => {
    return (<></>);
})

const JEFeatureCardHeader = () => {
    return (<>
        <div className="card-header bg-transparent border-bottom card-header-tabs">
            <ul className="nav justify-content-center">
                <li className="nav-item">
                    <a className="nav-link active" data-bs-toggle="tab" data-bs-target="#online" type="button" role="tab" href="#online"><h2><img src={Globe} alt="Online" className="mr-2" />Online</h2></a>
                </li>
                <li className="nav-item">
                    <a className="nav-link" data-bs-toggle="tab" data-bs-target="#offline" type="button" role="tab" href="#offline"><h2><img src={Shop} alt="Shop" className="mr-2" />Offline</h2></a>
                </li>
            </ul>
        </div>
    </>);
}

export default JEFeatureCardHeader;
